import Vue from "vue";
import App from "./App.vue";
import router from "./router";

Vue.config.productionTip = false;

let data = {
  users: [{ username: "admin", password: "1234" }],
  currentImage: "",
  saved: [
    {
      username: "admin",
      favorites: [
        "https://apod.nasa.gov/apod/image/2203/Road2Stars_EsoHoralek_1080.jpg",
      ],
    },
  ],
  isLoggedIn: false,
};

new Vue({
  router,
  data,
  render: (h) => h(App),
}).$mount("#app");
